(1, 'Espero que las autoridades correspondientes tomen medidas efectivas para solucionar este problema y evitar que se repita en el futuro.', 'juan', 'fernando', 'Calle Principal #1234, Colonia Centro Ciudad de México, Código Postal 06000, México', 'El Parque Nacional Yellowstone, ubicado en los Estados Unidos, es un lugar de gran belleza natural y rica en vida silvestre. Con una superficie de más de 8.000 kilómetros cuadrados, el parque es el hogar de numerosas especies de animales, como bisontes, osos, lobos y alces, así como una gran variedad de aves y peces. También cuenta con impresionantes', 527711285978, 'ejemplo@gmai.com', '2023-03-14 06:18:26', '2023-03-14 06:18:26'),
(2, 'Estimados señores,\r\n\r\nPor medio de la presente, quiero presentar una denuncia formal en contra del Sr. Juan Pérez, quien es mi vecino en el edificio ubicado en la calle Libertad 123. El motivo de mi denuncia es que el Sr. Pérez ha estado realizando constantemente fiestas en su departamento los fines de semana, causando un nivel de ruido excesivo y molesto para los demás vecinos del edificio.\r\n\r\nEl ruido generado por las fiestas ha afectado mi descanso, el de mi familia y el de otros vecinos del edificio. He intentado hablar con el Sr. Pérez en varias ocasiones para pedirle que baje el volumen, pero ha ignorado mis solicitudes y las de otros vecinos.', 'Enrique', 'Hdez', 'Calle Principal #1234, Colonia Centro Ciudad de México, Código Postal 06000, México', 'El Parque Nacional Yellowstone, ubicado en los Estados Unidos, es un lugar de gran belleza natural y rica en vida silvestre. Con una superficie de más de 8.000 kilómetros cuadrados, el parque es el hogar de numerosas especies de animales, como bisontes, osos, lobos y alces, así como una gran variedad de aves y peces. También cuenta con impresionantes', 527711285978, 'ejemplo@gmai.com', '2023-03-14 06:20:31', '2023-03-14 06:20:31');

