(1, 'Por medio de la presente, quiero presentar una denuncia formal en contra del Sr. Juan Pérez, quien es mi vecino en el edificio ubicado en la calle Libertad 123. El motivo de mi denuncia es que el Sr. Pérez ha estado realizando constantemente fiestas en su departamento los fines de semana, causando un nivel de ruido excesivo y molesto para los demás vecinos del edificio.\r\n\r\nEl ruido generado por las fiestas ha afectado mi descanso, el de mi familia y el de otros vecinos del edificio. He intentado hablar con el Sr. Pérez en varias ocasiones para pedirle que baje el volumen, pero ha ignorado mis solicitudes y las de otros vecinos.\r\n\r\nAdjunto a esta denuncia copias de algunas de las quejas que he registrado en el libro de reclamaciones del edificio y en el departamento de seguridad del mismo.\r\n\r\nEspero que las autoridades correspondientes tomen medidas efectivas para solucionar este problema y evitar que se repita en el futuro.\r\n\r\nAgradezco de antemano su atención y pronta respuesta.\r\n\r\nAtentamente,', 545646545661, '2023-03-14 06:19:34', '2023-03-14 06:19:34');

