(26, 1, 12, 'Upload files to server in Flutter', 'upload-files-to-server-in-flutter', '<p>Lorem ipsum was conceived as filler text, formatted in a certain way to enable the presentation of graphic elements in documents, without the need for formal copy. Using Lorem Ipsum allows designers to put together layouts and the form of the content before the content has been created, giving the design and production process more freedom.</p>\r\n\r\n<p>It is widely believed that the history of Lorem Ipsum originates with&nbsp;<a href=\"https://en.wikipedia.org/wiki/Cicero\">Cicero</a>&nbsp;in the 1st Century BC and his text&nbsp;De Finibus bonorum et malorum. This philosophical work, also known as&nbsp;On the Ends of Good and Evil, was split into five books. The Lorem Ipsum we know today is derived from parts of the first book&nbsp;Liber Primus&nbsp;and its discussion on hedonism, the words of which had been altered, added and removed to make it nonsensical and improper Latin. It is not known exactly when the text gained its current traditional form. However references to the phrase &quot;lorem ipsum&quot; can be found in the&nbsp;1914 Loeb Classical Library Edition of the De Finibus&nbsp;in sections 32 and 33.</p>', NULL, '1670569497_programming-g15787c63d_1280.png', '2022-12-09 05:04:58', '2023-03-12 02:00:34'),
