(1, 'Parametro Diario', 'info@larablogdev.com', '¡Bienvenidos al noticiero más completo y actualizado de la televisión! Aquí encontrarás la información más relevante y de última hora sobre los acontecimientos más importantes del mundo, desde política y economía hasta deportes y entretenimiento.\n\nNuestro equipo de periodistas altamente capacitados y experimentados, están siempre en búsqueda de la verdad y la objetividad, para brindarte una cobertura imparcial y completa de los sucesos más importantes de la actualidad.\n\nAdemás, con nuestros expertos analistas y corresponsales en todo el mundo, podrás obtener una visión profunda y detallada de los temas más relevantes en diferentes partes del planeta.', '1678983827_59957_larablog_logo.png', '1678743787_1845_larablog_favicon.ico', NULL, '2023-03-16 22:23:47');

